import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Users from './user/pages/Users';
import NewPlaces from './places/pages/NewPlaces';

const App = () => {
  return (
    <Routes>
      <Route path='/user' element={<Users />} />
    </Routes>
  );
};

export default App;
